import React from 'react'
import './MiniLibrary.css'
const MiniLibrary = () => {
  return (
    <div className='mini-library hero-container'>
      <h2 className='heading-style-one'>Mini Library</h2>
      <div>
        <img src='/assets/libraryMain.svg'/>
      </div>
      </div>
  )
}

export default MiniLibrary
